INSERT INTO `examen_medico` VALUES (1,'examen fisico','es un examen en el que el médico revisa el cuerpo del paciente para evaluar su estado de salud general'),(2,'Análisis de sangre','se utiliza para detectar y medir una amplia variedad de sustancias en la sangre, incluyendo glucosa, colesterol, triglicéridos, enzimas hepáticas, hormonas y células sanguíneas.'),(3,'Pruebas de orina','se utilizan para detectar infecciones del tracto urinario, enfermedades del riñón y otras afecciones'),(4,'Radiografía','es una imagen del interior del cuerpo que se obtiene mediante rayos X.'),(5,'Ecografía','es una técnica de imagen que utiliza ondas sonoras para producir imágenes de los órganos internos.'),(6,'Electrocardiograma (ECG)','se utiliza para registrar la actividad eléctrica del corazón y detectar problemas cardíacos.'),(7,'Mamografía','es una radiografía de las mamas que se utiliza para detectar el cáncer de mama.'),(8,'Colonoscopia','es un examen que se realiza para detectar cáncer de colon y otras afecciones del tracto intestinal.'),(9,'Prueba de esfuerzo','se utiliza para evaluar la salud del corazón durante el ejercicio'),(10,'Examen de la vista','se utiliza para evaluar la visión y detectar problemas como la miopía, la hipermetropía y el astigmatismo'),(11,'Ninguno',NULL);
