INSERT INTO `medicamentos` VALUES (1,'Paracetamol',10,2,'Diario'),(2,'Aspirina',4,1,'Interdiario'),(3,'Hisaler',2.5,1,'Durante 3 Dias'),(4,'Bisolvon',25,1,'Diario'),(5,'Amoxicilina',2,1,'3 Dias En Las Mañanas'),(6,'Azitromicina',4.5,1,'Por una semana'),(7,'Asepsia',12,1,'3 dias en las noches'),(8,'Simeticona',2,2,'Por 2 dias despues del almuerzo');
INSERT INTO `mensajes` VALUES (1,'Hola, este es el Dr. Pérez de la Clínica XYZ. Quería recordarte que tienes una cita programada conmigo el próximo martes a las 10 am. Por favor, confirma si podrás asistir o si necesitas reprogramarla. ¡Gracias!','2023-04-25 20:00:00',1),(2,'Hola, soy la Dra. Sánchez. Quería informarte que los resultados de tus análisis de sangre ya están disponibles. Todo parece estar normal, pero necesito que vengas a la clínica para revisarlos juntos y resolver cualquier duda que puedas tener. Por favor, dime cuándo puedes venir.','2023-04-26 20:00:00',2);
INSERT INTO `notificaciones` VALUES (1,'Recordatorio de cita: Recuerda que tienes una cita con el Dr. García el martes 27 de abril a las 2 p.m. en nuestra clínica. Por favor, confirma tu asistencia ','23766788'),(2,'Resultados de exámenes: Los resultados de tus análisis de sangre están disponibles. Por favor, llama a nuestra clínica para programar una cita para revisarlos con el Dr. Sánchez.  ','23456789'),(3,'Cambio de horario: Queremos informarte que debido a una emergencia médica, el Dr. Rodríguez no estará disponible hoy. Tu cita ha sido reprogramada para el próximo martes a la misma hora.','22647853'),(4,'Notificación de facturación: Te informamos que tienes un saldo pendiente en nuestra clínica. Por favor, llama a nuestro departamento de facturación para solucionar este asunto.','28573467');
